import { GET_ANALYSIS, DELETE_ANALYSIS } from "../actions/types";

const initialState = {
  analysis: [],
};

export default function (state = initialState, action) {
  switch (action.type) {
    case GET_ANALYSIS:
      return {
        ...state,
        analysis: action.payload,
      };

    case DELETE_ANALYSIS:
      return {
        ...state,
        analysis: state.analysis.filter((item) => item.id !== action.payload),
      };

    default:
      return state;
  }
}
